import React from 'react'
import './home.css'
import shareHomeFeaturedData from '../../data/homeFeaturedData'


export default function Home() {
  let datas = shareHomeFeaturedData()
  return (
    <>
      <div className="showProducts">
        <ul className="ulFeaturedProducts">
          datas.map()
        </ul>

      </div>


    </>
  )
}
